CREATE DEFINER=`slendixx`@`%` PROCEDURE `activity_student_exist`(
	IN activityId INT,
    IN studentId INT,
    IN gradeValue INT,
    OUT activityExists INT,
    OUT studentExists INT
)
BEGIN
	SELECT EXISTS (
		SELECT id, calificacion_maxima 
        FROM actividad 
        WHERE id = activityId 
        AND calificacion_maxima IS NOT NULL
        AND gradeValue >= 1
        AND gradeValue <= calificacion_maxima
	) INTO activityExists;
    SELECT EXISTS (SELECT id FROM usuario WHERE id = studentId) INTO studentExists;
END ;;
